import { Link } from "react-router-dom";
import Logo from "../../assets/lightCubeLogo.png";

const Navigator = () => {
  return (
    <header className="fixed left-0 bottom-5 w-full bg-slate-900 mx-auto flex items-center justify-center p-1 border-2 border-slate-50 rounded-full">
      <Link to="/">
        <img src={Logo} alt="logo" className="w-10" />
      </Link>
    </header>
  );
};

export default Navigator;
